Компания TVERBUS предоставляет транспортные услуги высокого уровня в сфере пассажирских перевозок.
Наш автопарк состоит из автомобилей известных производителей Mercedes, Volkswagen, Ford, Iveco, Hyundai и др. Основу парка составляют новые автобусы( 25-50 мест) и микроавтобусы( 6-20 мест).

Наша компания оказывает широкий перечень услуг по аренде авто:

📍аренда автобуса;
📍заказ микроавтобуса, легковых автомобилей;
📍автобусы и микроавтобусы на свадьбу и другие торжества;
📍трансфер в аэропорт и на вокзал;
📍деловые поездки и экскурсии по России;
📍перевозка сотрудников, персонала, рабочих.

Аренда автобусов стоит не так дорого, как кажется, а качество пассажирских перевозок выше аналогичных компаниях, ведь аренда автобуса готовится под конкретного клиента, на условленное место и время, автобус всегда чист и ухожен.
